        "Talk": [
            [
                {
                    "N": "Нэко",
                    "T": "Починку ящика поручаю вам... Мяу-мяу."
                },
                {
                    "N": "_0",
                    "T": "Ты вдруг разучилась говорить..."
                },
                {
                    "N": "Нэко",
                    "T": "Говорить по-человечески... так утомительно. Мяу-мяу."
                },
                {
                    "N": "_0",
                    "T": "Я починю ящик, не переживай."
                },
                {
                    "N": "Нэко",
                    "T": "Тогда займитесь этим. Мяу..."
                }
            ]
        ]
