    "7215512": {
        "Desc": "Разыщите в лагере материалы для ремонта",
        "Talk": [
            [
                {
                    "N": "Похититель сокровищ",
                    "T": "Ой! Не надо нас бить! Мы сдаёмся!"
                },
                {
                    "N": "_0",
                    "T": "Чем это вы здесь занимаетесь?"
                },
                {
                    "N": "Похититель сокровищ",
                    "T": "Мы тут так просто копаемся, мало ли, никогда не знаешь, где тебе повезёт..."
                },
                {
                    "N": "_0",
                    "T": "Мне нужна правда."
                },
                {
                    "N": "_0",
                    "T": "Три, два..."
                },
                {
                    "N": "Похититель сокровищ",
                    "T": "Ладно-ладно, мы всё расскажем!"
                },
                {
                    "N": "Похититель сокровищ",
                    "T": "Нам рассказали, что на Сэйрае есть сокровища. А вот людей на острове почти нет..."
                },
                {
                    "N": "Похититель сокровищ",
                    "T": "И мы решили попытать удачи."
                },
                {
                    "N": "Похититель сокровищ",
                    "T": "Но... мы ничего не нашли! Эта деревня выглядит заброшенной Архонты знают сколько лет назад."
                },
                {
                    "N": "Похититель сокровищ",
                    "T": "Какие там сокровища, мы ни одной целой деревяшки тут не нашли!"
                },
                {
                    "N": "_1005",
                    "T": "Тут всё сломано? А где же нам тогда найти материалы для ремонта..."
                },
                {
                    "N": "_0",
                    "T": "У вас есть лагерь?"
                },
                {
                    "N": "Похититель сокровищ",
                    "T": "Э-э... Ну есть, конечно. А что ты собираешься..."
                },
                {
                    "N": "_0",
                    "T": "В лагере есть гвозди, доски и верёвки?"
                },
                {
                    "N": "Похититель сокровищ",
                    "T": "Ну, есть вообще-то..."
                },
                {
                    "N": "Похититель сокровищ",
                    "T": "Лучше скажи прямо, что тебе нужно, мы не понимаем твои намёки!"
                },
                {
                    "N": "Похититель сокровищ",
                    "T": "#Раз ты нас победил{F#а}, можешь забирать нашу мору и сокровища, мы всё отдадим!"
                },
                {
                    "N": "Похититель сокровищ",
                    "T": "Только пощади, умоляем!"
                },
                {
                    "N": "_0",
                    "T": "Мне и правда нужны только доски и гвозди."
                },
                {
                    "N": "Похититель сокровищ",
                    "T": "#Эм... Ну тогда ты сам{F#а} сходи в наш лагерь и возьми то, что тебе нужно!"
                },
                {
                    "N": "_0",
                    "T": "А вы?"
                },
                {
                    "N": "Похититель сокровищ",
                    "T": "А мы... пока займемся другими делами. Прощай!"
                },
                {
                    "N": "Похититель сокровищ",
                    "T": "Ребята, дёру!"
                }
            ]
        ]
    },
