        "Step": "Прибыв на остров Сэйрай, вы обнаружили двух искателей приключений. Похоже, прямо сейчас они заняты исследованием так называемого «запирающего камня». Вы же по кошачьим следам приходите к разрушенному святилищу, где живет кошка Нэко, называющая себя «временной настоятельницей святилища Асасэ». Если вы поможете Нэко починить ящик для подношений в святилище, она расскажет вам, как запустить «запирающие камни». Если вы сможете наложить печати всех четырёх «запирающих камней», возможно, вам удастся положить конец грозе на острове Сэйрай...",
