    "7215801": {
        "Desc": "Запечатайте «запирающий камень»",
        "Talk": [
            [
                {
                    "N": "Эйко",
                    "T": "Гроза... стихла."
                },
                {
                    "N": "Тайсукэ",
                    "T": "Видимо, печати всех четырёх камней наложены."
                },
                {
                    "N": "_0",
                    "T": "Да."
                },
                {
                    "N": "Эйко",
                    "T": "Это ты! Как у тебя получилось туда забраться?"
                },
                {
                    "N": "Эйко",
                    "T": "#Тайсукэ сказал, что ты {F#прошла}{M#прошёл} через какую-то дверь и потом исчез{F#ла}."
                },
                {
                    "N": "Эйко",
                    "T": "Да что с этой дверью такое? Как странно..."
                },
                {
                    "N": "Тайсукэ",
                    "T": "Что же всё-таки произошло там, наверху?"
                },
                {
                    "N": "Тайсукэ",
                    "T": "Мы с Эйко услышали сверху грохот, похожий на раскаты грома."
                },
                {
                    "N": "Тайсукэ",
                    "T": "Но ведь гроза должна была утихнуть..."
                },
                {
                    "N": "_0",
                    "T": "Тут такое дело..."
                },
                {
                    "N": "Тайсукэ",
                    "T": "Платформа, которая собирается из парящих в воздухе камней..."
                },
                {
                    "N": "Тайсукэ",
                    "T": "Хм... Должен признать, что никогда не слышал о подобном естественном феномене на Сэйрае..."
                },
                {
                    "N": "Эйко",
                    "T": "...Какой же это естественный феномен..."
                },
                {
                    "N": "Эйко",
                    "T": "Как ни крути, это совершенно неестественный... феномен."
                },
                {
                    "N": "_0",
                    "T": "Точно."
                },
                {
                    "N": "_0",
                    "T": "Верно замечено."
                },
                {
                    "N": "Эйко",
                    "T": "Но каким бы ни был этот феномен, гроза над Сэйраем стихла. Мы выполнили поручение Гильдии."
                },
                {
                    "N": "_0",
                    "T": "И вот ещё, мы нашли странное перо."
                },
                {
                    "N": "Эйко",
                    "T": "Перо... Тайсукэ, взгляни-ка на него."
                },
                {
                    "N": "Тайсукэ",
                    "T": "Позволь мне посмотреть..."
                },
                {
                    "N": "Тайсукэ",
                    "T": "Прошу прощения, я не могу определить происхождение этого пера."
                },
                {
                    "N": "Тайсукэ",
                    "T": "На вид и на ощупь не похоже ни на одну известную мне птицу."
                },
                {
                    "N": "Тайсукэ",
                    "T": "Если исходить из размеров, то птица, оставившая его, должна быть такой же большой, как та каменная платформа в небе."
                },
                {
                    "N": "Эйко",
                    "T": "Это перо так важно? Если ты хочешь выяснить его историю, почему бы тебе не вывесить поручение в Гильдии? Кто знает, может, найдутся какие-то подсказки."
                },
                {
                    "N": "_0",
                    "T": "Хорошо."
                },
                {
                    "N": "_0",
                    "T": "#Я еще хочу подумать сам{F#а}."
                },
                {
                    "N": "Эйко",
                    "T": "#Что ж, в таком случае ещё раз спасибо за помощь, искатель{F#ница} приключений. Мы с Тайсукэ вернёмся в гильдию и возьмёмся за отчёты."
                },
                {
                    "N": "Эйко",
                    "T": "А, точно. Это для тебя. Тут, конечно, немного... Но всё же тебе положено хоть какое-то вознаграждение за помощь."
                },
                {
                    "N": "Эйко",
                    "T": "Тайсукэ, собирайся. Мы возвращаемся в Гильдию."
                },
                {
                    "N": "Тайсукэ",
                    "T": "М-м-м, Эйко... Давай быстренько заглянем в святилище и повидаемся с госпожой Нэко, хорошо?"
                },
                {
                    "N": "Эйко",
                    "T": "Тайсукэ..."
                },
                {
                    "N": "Тайсукэ",
                    "T": "Слушай, но ведь это говорящая кошка! Говорящая!"
                },
                {
                    "N": "Эйко",
                    "T": "Ох, парень..."
                }
            ]
        ]
    },
